import React from 'react';

const About: React.FC = () => {
    return (
        <section className="about">
            <h2>About Our Research Group</h2>
            <p>
                Our research group is dedicated to advancing knowledge in our field through innovative research and collaboration. 
                We strive to foster an environment of creativity and inquiry, where ideas can flourish and lead to impactful discoveries.
            </p>
            <h3>Mission</h3>
            <p>
                Our mission is to conduct high-quality research that addresses critical challenges and contributes to the betterment of society.
            </p>
            <h3>Vision</h3>
            <p>
                We envision a future where our research leads to transformative solutions and inspires the next generation of researchers.
            </p>
        </section>
    );
};

export default About;
